import OutputScreenRow from './outputScreenRow.js';

const OutputScreen = (props) => {
  return (
    <div className="screen">
      <OutputScreenRow value = {this.state.question}/>
      <OutputScreenRow value = {this.state.answer}/>
    </div>
  )
}

export default OutputScreen;
